INSERT INTO `album` VALUES (1,'Diseñando apps con estilo y funcionalidad','<p><span style=\"color: #111111; font-family: -apple-system, Roboto, SegoeUI, \'Segoe UI\', \'Helvetica Neue\', Helvetica, \'Microsoft YaHei\', \'Meiryo UI\', Meiryo, \'Arial Unicode MS\', sans-serif; font-size: 14px; background-color: rgba(255, 255, 255, 0.6);\">Un &aacute;lbum que muestra algunos de los mejores ejemplos de dise&ntilde;o de aplicaciones m&oacute;viles y web, desde la interfaz de usuario hasta la experiencia de usuario. Aprende c&oacute;mo crear apps atractivas, intuitivas y eficientes que satisfagan las necesidades de los usuarios y los clientes. Insp&iacute;rate con las tendencias actuales y las mejores pr&aacute;cticas en el campo del dise&ntilde;o de apps.</span></p>','2020-10-04 22:01:17',1,1,'2025-11-08 00:00:00','2025-12-10 00:00:00',NULL);
