code\\\" \\n                 class=\\\"img-fluid rounded-4 shadow-sm\\\" loading=\\\"lazy\\\">\\n        <\\/div>\\n    <\\/div>\\n    \\n    <hr class=\\\"my-5\\\">\\n\\n    <div class=\\\"row g-5\\\">\\n        <div class=\\\"col-lg-8\\\">\\n            <section class=\\\"mb-5\\\">\\n                <h3 class=\\\"h4 mb-3 fw-bold\\\"><i class=\\\"bi bi-rocket-takeoff text-primary me-2\\\"><\\/i>Our Mission<\\/h3>\\n                <p class=\\\"text-secondary\\\">\\n                    Start CMS was created with a clear goal: to provide developers and content creators with a tool that eliminates unnecessary complexity. We aim for the perfect balance between a <strong>robust backend system<\\/strong> and a <strong>lightweight user experience<\\/strong>. You are now ready to build faster.\\n                <\\/p>\\n            <\\/section>\\n\\n            <section>\\n                <h3 class=\\\"h4 mb-3 fw-bold\\\">Why Start CMS?<\\/h3>\\n                <div class=\\\"list-group list-group-flush border rounded-3 shadow-sm bg-white\\\">\\n                    <div class=\\\"list-group-item p-3 d-flex align-items-start\\\">\\n                        <i class=\\\"bi bi-speedometer2 fs-4 text-success me-3 mt-1\\\"><\\/i>\\n                        <div>\\n                            <h6 class=\\\"mb-1 fw-bold text-dark\\\">Performance First<\\/h6>\\n                            <small class=\\\"text-muted\\\">Engineered for speed. Optimized database queries and minimal overhead ensure fast page loads.<\\/small>\\n                        <\\/div>\\n                    <\\/div>\\n                    <div class=\\\"list-group-item p-3 d-flex align-items-start\\\">\\n                        <i class=\\\"bi bi-palette2 fs-4 text-info me-3 mt-1\\\"><\\/i>\\n                        <div>\\n                            <h6 class=\\\"mb-1 fw-bold text-dark\\\">Modern Interface<\\/h6>\\n                            <small class=\\\"text-muted\\\">A clean, responsive admin panel built