INSERT INTO `page` VALUES (100,'blade-templates','default','Blade Templates','','<!-- wp:paragraph -->\n<p>Blade is the simple, yet powerful templating engine provided with Laravel. Unlike other popular PHP templating engines, Blade does not restrict you from using plain PHP code in your views. In fact, all Blade views are compiled into plain PHP code and cached until they are modified, meaning Blade adds essentially zero overhead to your application. Blade view files use the&nbsp;<code>.blade.php</code>&nbsp;file extension and are typically stored in the&nbsp;<code>resources/views</code>&nbsp;directory.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->',NULL,1,1,1,0,0,0,'default',NULL,NULL,'2025-12-07 00:00:00','2025-12-08 00:00:00','2025-11-26 00:00:00','2020-11-27 02:03:51'),(102,'blog/blog-typescript-the-best-resources-to-learn-it','default','TypeScript: The Best Resources to Learn It','','<!-- wp:paragraph -->\n<p>If you\'re looking to learn TypeScript, you\'re in luck. There are plenty of resources available to help you get started and improve your skills.</p><p>First and foremost, the TypeScript website itself is a great resource. It offers detailed documentation and tutorials to help you understand the basics and dive deeper into the language.</p><p>Another excellent resource is the TypeScript Deep Dive book by Basarat Syed. This comprehensive guide covers everything from TypeScript fundamentals to advanced concepts and best practices.</p><p>For a more interactive learning experience, you can check out the TypeScript course on Pluralsight. The course is taught by expert instructor Dan Wahlin and covers the essential concepts and features of TypeScript.</p><p>If you prefer learning through videos, the TypeScript Tutorial for Beginners playlist on the Academind YouTube channel is a great option. The videos are well-paced and cover a wide range of topics, from getting started with TypeScript to working with classes and interfaces.</p><p>Another great YouTube channel for learning TypeScript is Fun Fun Function. Hosted by software engineer Mattias Petter Johansson, the channel features a variety of videos on topics such as TypeScript and React, TypeScript and Angular, and much more.</p><p>Finally, for hands-on learning, you can try out the TypeScript Exercises on Exercism. These exercises cover a wide range of topics and difficulty levels, allowing you to learn and practice your TypeScript skills at your own pace.</p><p>Overall, there are many great resources available for learning TypeScript. Whether you prefer books, videos, online courses, or hands-on exercises, there\'s something out there for everyone. So, start exploring and start learning today!</p>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','null',2,1,1,0,0,2,'default',2097,NULL,'2025-11-02 00:00:00','2025-12-11 00:00:00','2025-11-06 00:00:00','2020-12-03 00:50:01'),(103,'blog/materialize-css-the-little-library-for-material-design','templates.sideBarTemplate','Materialize CSS the little library for Material Design','What does Materialize CSS give us in Web Development?','<div class=\"container\"><h2>Materialize CSS: The Little Library for Material Design</h2><p class=\"flow-text\">Discover how Materialize CSS brings Google\'s Material Design to the web.</p><h3>Why Materialize CSS?</h3><p>When building Start CMS, we needed a CSS framework that was beautiful, component-rich, and easy to customize.</p><h3>Real-World Example: Start CMS</h3><p>Every page in Start CMS uses Materialize CSS for a consistent, professional look.</p><p>Want to explore more? Check out <a href=\"/blog/meet-material-design\">Material Design principles</a> or learn about <a href=\"/blog/lightweight-and-powerful-codeigniter-the-php-framework\">CodeIgniter</a>.</p></div>','{\"time\":1668485381933,\"blocks\":[{\"id\":\"71b-Ond43L\",\"type\":\"header\",\"data\":{\"text\":\"\\u00bfQu\\u00e9 nos aporta Materialize CSS en Desarrollo Web?\",\"level\":1}},{\"id\":\"_UtAhdqik-\",\"type\":\"paragraph\",\"data\":{\"text\":\"\"}},{\"id\":\"sEqIb0Hl-7\",\"type\":\"paragraph\",\"data\":{\"text\":\"Por un lado,&nbsp;las ventajas de Materialize CSS:\"}},{\"id\":\"J2GBQssKgT\",\"type\":\"list\",\"data\":{\"style\":\"unordered\",\"items\":[\"El tiempo de desarrollo es menor, pues la mayor parte del c\\u00f3digo nos lo encontramos ya escrito.\",\"Si no somos muy h\\u00e1biles en el dise\\u00f1o podemos aplicar un framework CSS para conseguir una bonita est\\u00e9tica en nuestros proyectos.\",\"Los dise\\u00f1os son m\\u00e1s robustos y la est\\u00e9tica final es m\\u00e1s homog\\u00e9nea.\",\"Materialize s\\u00f3lo ocupa aproximadamente unos 140 KB con su CSS, a lo que hay que a\\u00f1adirle 180 KB con el JS.\"]}},{\"id\":\"lf7S-qFGWl\",\"type\":\"paragraph\",\"data\":{\"text\":\"Y, como todo tiene su lado negativo,&nbsp;algunos de sus inconvenientes:\"}},{\"id\":\"h-X2GRicCJ\",\"type\":\"list\",\"data\":{\"style\":\"unordered\",\"items\":[\"Tal vez se cuela m\\u00e1s c\\u00f3digo del que vas a utilizar, aunque siempre podr\\u00e1s quitar lo que no te interese.\",\"Si alguna vez quieres cambiar de framework su adaptaci\\u00f3n ser\\u00e1 m\\u00e1s liosa.\",\"El dise\\u00f1o que realizas no es del todo exclusivo y podr\\u00e1s ver, casi con seguridad, algo parecido en otros sitios.\"]}},{\"id\":\"CGKdKOSck1\",\"type\":\"header\",\"data\":{\"text\":\"Materialize vs otros frameworks\",\"level\":2}},{\"id\":\"mE06Lr6Jw2\",\"type\":\"paragraph\",\"data\":{\"text\":\"\"}},{\"id\":\"wcDIJuYhot\",\"type\":\"list\",\"data\":{\"style\":\"unordered\",\"items\":[\"No requiere jQuery para funcionar.\",\"Usa desde el principio recomendaciones CSS que otros frameworks a\\u00fan no implementan (o que han tardado bastante tiempo en incorporar).\",\"Al usar Material Design de Google, los usuarios est\\u00e1n m\\u00e1s familiarizados.\"]}},{\"id\":\"9fN1d7-zz6\",\"type\":\"header\",\"data\":{\"text\":\"Primeros pasos con Materialize CSS\",\"level\":2}},{\"id\":\"OZf__Nxgi3\",\"type\":\"paragraph\",\"data\":{\"text\":\"Hemos de incluir los archivos con la hoja de estilos y el JavaScript. En caso de hacerlo mediante el CDN incluiremos un par de l\\u00edneas de c\\u00f3digo en nuestra p\\u00e1gina.\"}},{\"id\":\"WxV6yHXokK\",\"type\":\"paragraph\",\"data\":{\"text\":\"\"}},{\"id\":\"y6w7wAmoy5\",\"type\":\"paragraph\",\"data\":{\"text\":\"Si lo hacemos con CDN tenemos la ventaja de que nos ahorra la descarga de los archivos desde nuestro servidor y la respuesta suele ser m\\u00e1s r\\u00e1pida.\"}},{\"id\":\"6Kmi1J5c85\",\"type\":\"paragraph\",\"data\":{\"text\":\"Para hacer un bot\\u00f3n estilizado, usaremos una etiqueta&nbsp;a, con unas clases CSS determinadas.\"}},{\"id\":\"HKYbnS1p1a\",\"type\":\"paragraph\",\"data\":{\"text\":\"\"}},{\"id\":\"Gcy8B26HDi\",\"type\":\"paragraph\",\"data\":{\"text\":\"Y si queremos hacer un icono, podremos usar el siguiente c\\u00f3digo:\"}},{\"id\":\"TTBdsKNMqZ\",\"type\":\"paragraph\",\"data\":{\"text\":\"\"}},{\"id\":\"h8BSPH_Jq8\",\"type\":\"paragraph\",\"data\":{\"text\":\"Para algo m\\u00e1s complejo, como por ejemplo hacer una tarjeta, podemos aplicar algunas clases CSS.\"}},{\"id\":\"-sUizd2wCs\",\"type\":\"paragraph\",\"data\":{\"text\":\"\"}}],\"version\":\"2.22.2\"}',2,1,1,0,0,1,'default',1949,NULL,'2025-12-03 00:00:00','2025-11-28 00:00:00','2025-11-19 00:00:00',NULL),(104,'blog/meet-material-design','templates.sideBarTemplate','Meet Material Design, the Design System of Google','Material Design, the Design System of Google','<div class=\"container\"><h2>Meet Material Design</h2><p class=\"flow-text\">Google\'s design language that makes interfaces intuitive and beautiful.</p><h3>What is Material Design?</h3><p>Material Design is Google\'s comprehensive design system using depth, motion, bold colors, and a grid system.</p><h3>Material Design in Start CMS</h3><p>We have implemented Material Design throughout Start CMS for a consistent, professional admin experience.</p><p>Learn more: <a href=\"/blog/materialize-css-the-little-library-for-material-design\">Materialize CSS Tutorial</a> or <a href=\"/services\">Start CMS Features</a>.</p></div>',NULL,2,1,1,0,0,1,'default',1950,NULL,'2025-12-16 00:00:00','2025-12-05 00:00:00','2025-12-12 00:00:00',NULL),(105,'blog/lightweight-and-powerful-codeigniter-the-php-framework','templates.sideBarTemplate','Lightweight and powerful: CodeIgniter the php framework ','','<div class=\"container\"><h2>Lightweight and Powerful: CodeIgniter</h2><p class=\"flow-text\">Why CodeIgniter remains one of the best choices for PHP development.</p><h3>Why CodeIgniter?</h3><p>When building Start CMS, we chose CodeIgniter for its speed, small footprint, MVC architecture, and great documentation.</p><h3>Start CMS Architecture</h3><p>We use CodeIgniter with a custom base model, Blade templates, and a RESTful API for maximum flexibility.</p><p>Further reading: <a href=\"/services\">Start CMS Features</a> or <a href=\"/blog/materialize-css-the-little-library-for-material-design\">Materialize CSS</a>.</p></div>','{\"time\":1668643247027,\"blocks\":[{\"id\":\"9CUfaZBH4g\",\"type\":\"paragraph\",\"data\":{\"text\":\"CodeIgniter is loosely based on the popular model\\u2013view\\u2013controller (MVC) development pattern. While controller classes are a necessary part of development under CodeIgniter, models and views are optional. CodeIgniter can be also modified to use Hierarchical Model View Controller (HMVC) which allows the developers to maintain modular grouping of Controller, Models and View arranged in a sub-directory format.\"}}],\"version\":\"2.22.2\"}',2,1,1,0,0,1,'default',1289,NULL,'2025-12-18 00:00:00','2025-12-14 00:00:00','2025-11-11 00:00:00',NULL),(106,'about-us','default','About Us','','<div class=\"container py-5\">\n    \n    <div class=\"row align-items-center mb-5\">\n        <div class=\"col-lg-6 mb-4 mb-lg-0\">\n            <span class=\"badge bg-primary mb-2\">New Installation</span>\n            <h1 class=\"display-4 fw-bold text-dark\">Welcome to Start CMS</h1>\n            <p class=\"lead text-secondary\">\n                Your new modern, flexible content management system. Built with the power of CodeIgniter and the elegance of Bootstrap 5.\n            </p>\n            <div class=\"mt-4\">\n                <a href=\"/docs\" class=\"btn btn-primary me-2\"><i class=\"bi bi-book me-2\"></i>Read Documentation</a>\n                <a href=\"/admin/settings\" class=\"btn btn-outline-secondary\"><i class=\"bi bi-gear me-2\"></i>Configure Now</a>\n            </div>\n        </div>\n        <div class=\"col-lg-6\">\n            <img src=\"https://images.unsplash.com/photo-1498050108023-c5249f4df085?auto=format&fit=crop&w=1000&q=80\" \n                 alt=\"Modern development workspace with laptop and code\" \n                 class=\"img-fluid rounded-4 shadow-sm\" loading=\"lazy\">\n        </div>\n    </div>\n    \n    <hr class=\"my-5\">\n\n    <div class=\"row g-5\">\n        <div class=\"col-lg-8\">\n            <section class=\"mb-5\">\n                <h3 class=\"h4 mb-3 fw-bold\"><i class=\"bi bi-rocket-takeoff text-primary me-2\"></i>Our Mission</h3>\n                <p class=\"text-secondary\">\n                    Start CMS was created with a clear goal: to provide developers and content creators with a tool that eliminates unnecessary complexity. We aim for the perfect balance between a <strong>robust backend system</strong> and a <strong>lightweight user experience</strong>. You are now ready to build faster.\n                </p>\n            </section>\n\n            <section>\n                <h3 class=\"h4 mb-3 fw-bold\">Why Start CMS?</h3>\n                <div class=\"list-group list-group-flush border rounded-3 shadow-sm bg-white\">\n                    <div class=\"list-group-item p-3 d-flex align-items-start\">\n                        <i class=\"bi bi-speedometer2 fs-4 text-success me-3 mt-1\"></i>\n                        <div>\n                            <h6 class=\"mb-1 fw-bold text-dark\">Performance First</h6>\n                            <small class=\"text-muted\">Engineered for speed. Optimized database queries and minimal overhead ensure fast page loads.</small>\n                        </div>\n                    </div>\n                    <div class=\"list-group-item p-3 d-flex align-items-start\">\n                        <i class=\"bi bi-palette2 fs-4 text-info me-3 mt-1\"></i>\n                        <div>\n                            <h6 class=\"mb-1 fw-bold text-dark\">Modern Interface</h6>\n                            <small class=\"text-muted\">A clean, responsive admin panel built on Bootstrap 5 that looks great on any device.</small>\n                        </div>\n                    </div>\n                    <div class=\"list-group-item p-3 d-flex align-items-start\">\n                        <i class=\"bi bi-code-slash fs-4 text-warning me-3 mt-1\"></i>\n                        <div>\n                            <h6 class=\"mb-1 fw-bold text-dark\">Developer Friendly</h6>\n                            <small class=\"text-muted\">Clean, well-commented codebase following standard MVC patterns. Easy to extend and customize.</small>\n                        </div>\n                    </div>\n                    <div class=\"list-group-item p-3 d-flex align-items-start\">\n                        <i class=\"bi bi-hdd-network fs-4 text-danger me-3 mt-1\"></i>\n                        <div>\n                            <h6 class=\"mb-1 fw-bold text-dark\">Native REST API</h6>\n                            <small class=\"text-muted\">Headless-ready. Built-in API endpoints to connect easily with mobile apps or front-end frameworks like React or Vue.</small>\n                        </div>\n                    </div>\n                </div>\n            </section>\n        </div>\n\n        <div class=\"col-lg-4\">\n            <div class=\"card border-