rm-input-radio-li iphorm_5_36-input-li\\\">\\n                    <label class=\\\"iphorm_5_36_2_label\\\">\\n                        <div class=\\\"radio\\\" id=\\\"uniform-iphorm_5_36_6112eedcd2be1_2\\\"><span><input class=\\\"iphorm-element-radio iphorm_5_36 iphorm_5_36_2\\\" type=\\\"radio\\\" name=\\\"iphorm_5_36\\\" id=\\\"iphorm_5_36_6112eedcd2be1_2\\\" value=\\\"No thanks\\\"></span></div>\\n                        No thanks                    </label>\\n                </div>\\n                            <div class=\\\"iphorm-input-li iphorm-input-radio-li iphorm_5_36-input-li\\\">\\n                    <label class=\\\"iphorm_5_36_3_label\\\">\\n                        <div class=\\\"radio\\\" id=\\\"uniform-iphorm_5_36_6112eedcd2be1_3\\\"><span><input class=\\\"iphorm-element-radio iphorm_5_36 iphorm_5_36_3\\\" type=\\\"radio\\\" name=\\\"iphorm_5_36\\\" id=\\\"iphorm_5_36_6112eedcd2be1_3\\\" value=\\\"Don\'t know, please tell me more about responsive sites\\\"></span></div>\\n                        Don\'t know, please tell me more about responsive sites                    </label>\\n                </div>\\n                        </div>\\n                <p class=\\\"iphorm-description\\\">Please notice in your budget, that creating and testing responsive interfaces of the site for additional devices do require more work. You can read a short summary <a rel=\\\"lightbox\\\" href=\\\"http://janne.me/faq?iframe=true&amp;width=80%&amp;height=80%\\\">What is Responsive Design and why do we need it?</a> from my FAQ.</p>\\n        </div>\\n        <div class=\\\"iphorm-errors-wrap iphorm-hidden\\\">\\n    </div>    </div>\\n</div><div class=\\\"iphorm-element-wrap iphorm-element-wrap-select iphorm_5_38-element-wrap iphorm-clearfix iphorm-labels-above iphorm-element-optional\\\">\\n    <div class=\\\"iphorm-element-spacer iphorm-element-spacer-select iphorm_5_38-element-spacer\\\">\\n                    <label for=\\\"iphorm_5_38_6112eedcd2be1\\\">\\n                <strong>Timeline</strong>. When do you need this completed by?                                            </label>\\n                <div class=\\\"iphorm-input-wrap iphorm-input-wrap-select iphorm_5_38-input-wrap\\\">\\n            <div class=\\\"selector fixedWidth\\\" id=\\\"uniform-iphorm_5_38_6112eedcd2be1\\\"><span style=\\\"user-select: none;\\\">Please choose one…</span><select class=\\\"iphorm-element-select  iphorm_5_38\\\" name=\\\"iphorm_5_38\\\" id=\\\"iphorm_5_38_6112eedcd2be1\\\">\\n                                    <option value=\\\"Please choose one…\\\">Please choose one…</option>\\n                                    <option value=\\\"As soon as possible\\\">As soon as possible</option>\\n                                    <option value=\\\"Within 3 weeks\\\">Within 3 weeks</option>\\n                                    <option value=\\\"Within 6 weeks\\\">Within 6 weeks</option>\\n                                    <option value=\\\"Within 12 weeks\\\">Within 12 weeks</option>\\n                                    <option value=\\\"When you\'re available, let me know\\\">When you\'re available, let me know</option>\\n                            </select></div>\\n                <p class=\\\"iphorm-description\\\">I generally recommend at least three weeks for most projects, to ensure that the appropriate research and creative output is the best it can be.</p>\\n        </div>\\n        <div class=\\\"iphorm-errors-wrap iphorm-hidden\\\">\\n    </div>    </div>\\n</div><div class=\\\"iphorm-element-wrap iphorm-element-wrap-select iphorm_5_54-element-wrap iphorm-clearfix iphorm-labels-above iphorm-element-optional\\\" style=\\\"display: none;\\\">\\n    <div class=\\\"iphorm-element-spacer iphorm-element-spacer-select iphorm_5_54-element-spacer\\\">\\n                    <label for=\\\"iphorm_5_54_6112eedcd2be1\\\">\\n                <strong>Budget</strong>. How much are you planning to invest in the project? (USD, Including Responsive