e-text\">description</i><b>Page Management</b></li><li class=\"collection-item\"><i class=\"material-icons left green-text\">storage</i><b>Custom Models</b></li><li class=\"collection-item\"><i class=\"material-icons left orange-text\">folder</i><b>File Manager</b></li><li class=\"collection-item\"><i class=\"material-icons left red-text\">people</i><b>User Management</b></li><li class=\"collection-item\"><i class=\"material-icons left purple-text\">palette</i><b>Theme System</b></li><li class=\"collection-item\"><i class=\"material-icons left teal-text\">api</i><b>REST API</b></li></ul></div>','[]',1,1,1,0,0,1,'default',2093,NULL,'2025-11-07 00:00:00','2025-11-28 00:00:00','2025-11-04 00:00:00',NULL),(127,'portfolio/vuenotes','portfolioItem','VueNotes','','<div class=\"portfolio-details-slider swiper\">\n  <div class=\"swiper-wrapper align-items-center\">\n    <div class=\"swiper-slide\"> \n      <img alt=\"vuenotejs-slide-2-2023-01-05-133318\" src=\"/public/img/default.jpg\">\n    </div>\n    <div class=\"swiper-slide\">\n      <img alt=\"vuenotejs-slide-1-2023-01-05-133319\" src=\"/public/img/default.jpg\">\n    </div>\n  </div>\n  <div class=\"swiper-pagination\"></div>\n</div>\n<div class=\"container\">\n  <div class=\"row gy-4\">\n    <div class=\"col-lg-8\">\n      <article class=\"portfolio-description\">\n        <p>This app is developed using Vuejs, an open-source JavaScript framework for building user interfaces, and ElectronJs, a framework for building cross-platform desktop applications.<br></p><p>One of the key features of VueNotes is its clean and intuitive interface. You can easily create new notes and organize them into folders to keep your thoughts organized. The app also has a search function, allowing you to quickly find notes by keyword.</p><p>Another great feature of VueNotes is its cross-platform compatibility. You can use the app on both Mac and Windows, ensuring that you can access your notes on any device.</p><p><img alt=\"portfolio-6-2022-12-08-142547\" src=\"/public/img/default.jpg\"><br></p><p>VueNotes also has a rich text editor, allowing you to format your notes with different fonts, sizes, and colors. This makes it easy to highlight important information and make your notes more visually appealing.</p><p>One of the unique aspects of VueNotes is that it is an open-source project. This means that anyone can contribute to the development of the app and help make it even better.</p><p>In conclusion, VueNotes is a powerful app for taking notes and organizing your thoughts. With its clean interface, cross-platform compatibility, and rich text editor, it is a great tool for anyone looking to improve their productivity. Give it a try and see how it can help you stay organized and focused.</p>\n      </article>\n    </div>\n    <div class=\"col-lg-4\">\n      <div class=\"portfolio-info\">\n        <h3>Project information</h3>\n        <ul>\n          <li><strong>Category</strong>: Web Development</li>\n          <li><strong>Project date</strong>: 01 March, 2020</li>\n          <li><strong>Project URL</strong>: <a href=\"https://www.figma.com/file/sePMgmi0kFBaQbzrOYLaCn/VueNotes?node-id=11%3A18&amp;t=5OlTIGBaDo0V98Hb-1\" title=\"VueNotes Figma\" target=\"_blank\">VueNotes Figma</a></li>\n          <li><strong>Project URL</strong>: <a href=\"https://github.com/gervisbermudez/VueNotes\" title=\"VueNotes Github\" target=\"_blank\">VueNotes Github</a></li>\n        </ul>\n      </div>\n\n    </div>\n  </div>\n</div>','[]',1,1,1,0,0,1,'default',2111,NULL,'2025-11-30 00:00:00','2025-12-12 00:00:00','2025-11-23 00:00:00',NULL),(128,'portfolio/loanadmin','portfolioItem','LoanAdmin','','<div class=\"portfolio-details-slider swiper\">\n  <div class=\"swiper-wrapper align-items-center\">\n<div class=\"swiper-slide\">\n      <img alt=\"loanadmin-slide-2-2022-12-20-010746\" src=\"/public/img/default.jpg\">\n    </div>\n    <div class=\"swiper-slide\">\n      <img alt=\"loanadmin-slide-1-2022-12-20-010746\" src=\"/public/img/default.jpg\">\n    </div>\n    \n    <div class=\"swiper-slide\">\n      <img alt=\"loanadmin-slide-3-2022-12-20-010747\" src=\"/public/img/default.jpg\">\n    </div>\n  </div>\n  <div class=\"swiper-pagination\"></div>\n</div>\n<div class=\"container\">\n  <div class=\"row gy-4\">\n    <div class=\"col-lg-8\">\n      <article class=\"portfolio-description\">\n        <p>Are you tired of manually tracking your sales and incomes? Look no further than LoanAdmin!</p>\n        <p>Our web application offers a beautifully designed dashboard with a plethora of useful information to help you\n          stay on top of your finances. With LoanAdmin, you can easily monitor your sales and incomes, allowing you to\n          make informed decisions and grow your business.</p>\n        <p>But that\'s not all – LoanAdmin is also an open-source project, meaning you have the flexibility to customize\n          and improve the application to fit your specific needs. Plus, it\'s built with VueJs and CodeIgniter PHP,\n          ensuring a smooth and efficient user experience.</p>\n        <p><img alt=\"portfolio-3-2022-12-07-050923\" src=\"/public/img/default.jpg\"><br></p>\n        <p>Some of the key features of LoanAdmin include:</p>\n        <p>Detailed sales and income tracking: Keep track of your sales and incomes in real-time, with the ability to\n          view and analyze your data by date, product, and more.</p>\n        <p>Easy-to-use dashboard: Our intuitive dashboard makes it simple to view and manage your sales and incomes,\n          with clear, concise data visualizations to help you make informed decisions.</p>\n        <p>Customizable and open-source: As an open-source project, LoanAdmin allows you to tailor the application to\n          your specific needs, and even contribute to its development and improvement.</p>\n        <p>VueJs and CodeIgniter PHP: Built with VueJs and CodeIgniter PHP, LoanAdmin offers a fast and efficient user\n          experience, ensuring smooth and seamless interactions.</p>\n        <p>With LoanAdmin, you can easily and effectively manage your sales and incomes, allowing you to focus on\n          growing your business. Give it a try today and experience the benefits for yourself!</p>\n      </article>\n    </div>\n    <div class=\"col-lg-4\">\n      <div class=\"portfolio-info\">\n        <h3>Project information</h3>\n        <ul>\n          <li><strong>Category</strong>: Web Development</li>\n          <li><strong>Project date</strong>: 01 March, 2020</li>\n          <li><strong>Project URL</strong>: <a href=\"https://github.com/gervisbermudez/LoanAdmin\" title=\"LoanAdmin\" target=\"_self\">LoanAdmin Github</a></li><li><span style=\"font-weight: bolder;\">Project URL</span>:&nbsp;<a href=\"https://www.figma.com/file/5lKo64Ruz5iTqe6cyZuZeW/MyLoanAdmin?node-id=201%3A2&amp;t=k9uJTU59JT590kU9-1\" title=\"LoanAdmin Figma\" target=\"_self\">LoanAdmin Figma</a></li>\n        </ul>\n      </div>\n\n    </div>\n  </div>\n</div>','[]',1,1,1,0,0,1,'default',2104,NULL,'2025-10-24 00:00:00','2025-11-24 00:00:00','2025-10-25 00:00:00',NULL),(129,'portfolio/gervis-bermudez-brand','portfolioItem','Gervis Bermudez Brand','','<div class=\"portfolio-details-slider swiper\">\n  <div class=\"swiper-wrapper align-items-center\">\n    <div class=\"swiper-slide\">\n      <img alt=\"slide-1-2022-12-20-004425\" src=\"/public/img/default.jpg\"><br>\n    </div>\n    <div class=\"swiper-slide\">\n      <img alt=\"slide-2-2022-12-20-004440\" src=\"/public/img/default.jpg\">\n    </div>\n    <div class=\"swiper-slide\">\n      <img alt=\"slide-3-2022-12-20-004440\" src=\"/public/img/default.jpg\"><br>\n    </div>\n  </div>\n  <div class=\"swiper-pagination\"></div>\n</div>\n<div class=\"container\">\n  <div class=\"row gy-4\">\n    <div class=\"col-lg-8\">\n      <article class=\"portfolio-description\">\n        <p>As a web developer, it\'s important to have a strong and professional brand. That\'s why I chose the name\n          \"Gervis Bermudez\" for my brand.</p>\n        <p>First and foremost, the name is easy to pronounce and remember. It\'s unique and stands out among other web\n          developers.</p>\n        <p>In terms of design, I wanted to create a clean and modern look. The logo features a sleek and minimalist\n          font, with the initials \"GB\" in a bold and prominent position. The color scheme is a combination of dark blue\n          and white, representing professionalism and trustworthiness.</p>\n        <p>In addition, the website design follows the same principles of simplicity and cleanliness. The navigation is\n          clear and intuitive, making it easy for potential clients to find the information they need. The color scheme\n          is consistent throughout the website, giving it a cohesive and polished look.</p>\n        <p>Overall, the \"Gervis Bermudez\" brand represents my commitment to providing high-quality web development\n          services, with a focus on user-friendly and modern design. I believe that this brand accurately reflects my\n          skills and values as a web developer, and I\'m excited to continue building my brand and growing my business.\n        </p>\n        <p><img src=\"/public/img/default.jpg\"><br><br></p>\n        <h2>The Process</h2>\n        <p></p>\n        <p>As a web developer, I wanted to create a brand that accurately reflects my skills and expertise. After\n          careful consideration, I decided to go with the name \"Gervis Bermudez\" for my brand.</p>\n        <p>The first step in the branding process was to come up with a unique and memorable name. I wanted something\n          that would stand out and grab people\'s attention, while also being easy to pronounce and spell. \"Gervis\n          Bermudez\" fit the bill perfectly.</p>\n        <p>Next, I worked on creating a visual identity for my brand. I wanted to convey a professional and modern\n          image, so I chose a clean and minimalist design. The color scheme I selected was a combination of black,\n          white, and a pop of color to add a touch of personality.</p>\n        <p>Once the visual elements were in place, I focused on developing a brand message and positioning. I wanted to\n          showcase my skills as a web developer and emphasize my dedication to delivering high-quality, user-friendly\n          websites.</p>\n        <p>Finally, I integrated my brand into all of my online platforms, including my website and social media\n          profiles. I also created business cards and other marketing materials to help promote my brand.</p>\n        <p>Overall, the branding process for \"Gervis Bermudez\" was a time-intensive but rewarding experience. I\'m\n          confident that my brand accurately represents my skills and values as a web developer, and I\'m excited to see\n          where it takes me in the future.</p>\n      </article>\n    </div>\n    <div class=\"col-lg-4\">\n      <div class=\"portfolio-info\">\n        <h3>Project information</h3>\n        <ul>\n          <li><strong>Category</strong>: Web Development</li>\n          <li><strong>Project date</strong>: 01 March, 2020</li>\n        </ul>\n      </div>\n    </div>\n  </div>\n</div>','[]',1,1,1,0,0,1,'default',2101,NULL,'2025-11-25 00:00:00','2025-12-06 00:00:00','2025-11-17 00:00:00',NULL),(130,'porfolio/bridgestone-mobile-app-proposal','portfolioItem','Bridgestone Mobile App Proposal','','<div class=\"portfolio-details-slider swiper\">\n  <div class=\"swiper-wrapper align-items-center\">\n    <div class=\"swiper-slide\">\n      <img alt=\"slide-1-brigestone-app-1-2023-01-05-144436\" src=\"/public/img/default.jpg\">\n    </div>\n    <div class=\"swiper-slide\">\n      <img alt=\"slide-2-brigestone-app-1-2023-01-05-144437\" src=\"/public/img/default.jpg\">\n    </div>\n  </div>\n  <div class=\"swiper-pagination\"></div>\n</div>\n<div class=\"container\">\n  <div class=\"row gy-4\">\n    <div class=\"col-lg-8\">\n      <article class=\"portfolio-description\">\n        <p>The app is designed to help users easily find Bridgestone services in their area. With a simple and intuitive interface, the app allows users to search for services based on their location and the type of service they need.</p><p>The design process for the Bridgestone Mobile APP involved extensive research and analysis to understand the needs and preferences of our users. We conducted surveys and focus groups to gather insights and feedback from our customers, and used this information to inform the design of the app.</p><p>One of the key features of the app is its user-friendly interface. The app is designed to be easy to navigate, with clear and concise instructions on how to use the various features. The search function is also intuitive, allowing users to quickly and easily find the services they need.</p><p>Another important aspect of the app is its focus on providing accurate and relevant information to users. The app uses advanced algorithms to match users with the nearest and most relevant Bridgestone services, ensuring that users can find the help they need quickly and easily.</p><p>The Bridgestone Mobile APP also includes a range of useful features and tools, such as a tire pressure checker, a fuel efficiency calculator, and a service appointment booking tool. These tools are designed to help users better manage their vehicle and make informed decisions about their car\'s maintenance and care.</p><p>Overall, the Bridgestone Mobile APP is a valuable resource for anyone looking for Bridgestone services in their area. With its user-friendly interface, accurate information, and useful tools, the app is an essential tool for anyone looking to get the most out of their Bridgestone services.</p><p><br></p><p></p>\n<img alt=\"portfolio-5-2022-12-08-142105\" src=\"/public/img/default.jpg\">\n<h2><br>The Process</h2><br>As a designer, one of the most exciting and challenging aspects of my job is creating mobile app designs that not only look visually appealing but also function seamlessly for the user.<p></p><p>For the Bridgestone Mobile APP, I started by conducting user research to understand the needs and pain points of potential users. This allowed me to identify key features and functionalities that would enhance the user experience.</p><p>Next, I created wireframes to map out the layout and flow of the app. This helped me to ensure that the design was logical and easy to navigate.</p><p>Once the wireframes were finalized, I moved on to creating the visual design. I chose a bold color palette and clean, modern typography to give the app a fresh and contemporary look.</p><p>To improve the user experience, I also incorporated various interactive elements such as hover states and swipe gestures. These elements provide a more engaging and intuitive experience for the user.</p><p>Throughout the design process, I regularly sought feedback from stakeholders and potential users to ensure that the app met their needs and expectations.</p><p>The end result is a sleek and functional mobile app that provides a seamless user experience. I am confident that the Brigestone Mobile APP will be a valuable addition to the market.</p>\n      </article>\n    </div>\n    <div class=\"col-lg-4\">\n      <div class=\"portfolio-info\">\n        <h3>Project information</h3>\n        <ul>\n          <li><strong>Category</strong>: Web Development</li>\n          <li><strong>Project date</strong>: 01 March, 2020</li>\n          <li><strong>Project URL</strong>: <a href=\"https://www.figma.com/file/9nQdCImRQcElzj0cLYGLIr/Brigestone-Mobile-APP?node-id=41%3A38&amp;t=eV6ZCzKlSO6ypNpJ-1\" title=\"Bridgestone Mobile App Proposal Figma\" target=\"_self\">Bridgestone Mobile App Proposal Figma</a></li>\n        </ul>\n      </div>\n\n    </div>\n  </div>\n</div>','[]',1,1,1,0,0,1,'default',2110,NULL,'2025-11-07 00:00:00','2025-12-04 00:00:00','2025-12-12 00:00:00',NULL),(131,'portfolio/mobile-app-proposal','portfolioItem','Mobile App Proposal','','<div class=\"portfolio-details-slider swiper\">\n  <div class=\"swiper-wrapper align-items-center\">\n  <div class=\"swiper-slide\">\n   <img alt=\"slide-2-2-2022-12-29-161528\" src=\"/public/img/default.jpg\">\n    </div>\n    <div class=\"swiper-slide\">\n    <img alt=\"slide-1-1-2022-12-29-160240\" src=\"/public/img/default.jpg\">\n    </div>\n  </div>\n  <div class=\"swiper-pagination\"></div>\n</div>\n<div class=\"container\">\n  <div class=\"row gy-4\">\n    <div class=\"col-lg-8\">\n      <article class=\"portfolio-description\">\n        <p>As a designer, creating a mobile app that is both functional and visually appealing is always a challenge. However, with the right design process in place, it is possible to create an app that not only looks great, but also helps users find the services they need in their area.</p><p>The Mobile APP is a design proposal that aims to help users easily locate services in their area. To create this app, we used Figma as our design tool. Figma allows us to quickly create and iterate on design concepts, making it an ideal choice for our design process.</p><p><img alt=\"portfolio-4-2022-12-07-051113\" src=\"/public/img/default.jpg\"><br></p><p>The first step in the design process was to identify the target audience for the app. Our research indicated that the app would be most useful to people who are looking for services such as restaurants, grocery stores, or gas stations in their immediate area.</p><p>Next, we focused on creating a user-friendly interface that would make it easy for users to quickly find what they were looking for. We used clean, modern fonts and a simple color scheme to create a sleek and professional look for the app.</p><p>One of the key features of the Mobile APP is its map-based interface. The app uses the user\'s current location to provide them with a list of services in their immediate area. Users can also zoom in and out on the map to view more or less detail, depending on their needs.</p><p>To make the app even more user-friendly, we added a search function that allows users to search for specific services by name or keyword. This makes it easy for users to find exactly what they are looking for without having to scroll through a long list of options.</p><p>In addition to the map-based interface and search function, the Mobile APP also includes a number of other useful features. For example, users can save their favorite locations for quick access later, and they can also view reviews and ratings for each location to help them make informed decisions about which services to use.</p><p>Overall, the design process for the Mobile APP was focused on creating a user-friendly and visually appealing app that would help users quickly and easily find the services they need in their area. By using Figma and following a structured design process, we were able to create an app that is both functional and aesthetically pleasing.</p>\n      </article>\n    </div>\n    <div class=\"col-lg-4\">\n      <div class=\"portfolio-info\">\n        <h3>Project information</h3>\n        <ul>\n          <li><strong>Category</strong>: Web Development</li>\n          <li><strong>Project date</strong>: 01 March, 2020</li>\n          <li><strong>Project URL</strong>: <a href=\"https://www.figma.com/file/rJ1jYrzTh66lei3YsND8WL/Subastas---Adrian-Mercado-APP?node-id=0%3A1&amp;t=eV6ZCzKlSO6ypNpJ-1\" title=\"Mobile App Proposal Figma\" target=\"_self\">Mobile App Proposal Figma</a></li>\n        </ul>\n      </div>\n\n    </div>\n  </div>\n</div>','[]',1,1,1,0,0,1,'default',2105,NULL,'2025-12-07 00:00:00','2025-11-28 00:00:00','2025-11-22 00:00:00',NULL),(132,'error404notfound','error404Custom','Error404NotFound','','<p>Content of the page</p>','[]',1,1,1,0,0,2,'default',NULL,NULL,'2025-12-10 00:00:00','2025-11-22 00:00:00','2025-11-09 00:00:00',NULL),(133,'descubre-github-copilot-x-el-nuevo-asistente-para-programadores-que-integra-chatgpt-y-gpt-4','default','Descubre GitHub Copilot X: el nuevo asistente para programadores que integra ChatGPT y GPT-4','','<p>Hola, ¿te gustaría programar con la ayuda de una inteligencia artificial? Si es así, te presento el nuevo GitHub Copilot X, un ChatGPT integrado con el poderoso modelo GPT-4 de OpenAI. Con este asistente podrás escribir código más rápido, fácil y eficiente, además de resolver tus dudas y aprender nuevas habilidades.</p><p><br></p><p>GitHub Copilot X es una evolución del GitHub Copilot original, que ya te sugería y autocompletaba código basándose en tu contexto y tus preferencias. Pero ahora Copilot X va más allá: también te permite chatear con el asistente, tanto por texto como por voz, para pedirle que te explique el código que has escrito o que has encontrado en algún repositorio, que te genere pruebas unitarias, que te corrija los errores o que te recomiende las mejores prácticas y herramientas para tu proyecto.</p><p><br></p><p>Copilot X se integra de forma nativa con Visual Studio y VS Code, los populares entornos de desarrollo de Microsoft. Así podrás tener una ventana de chat junto a tu editor de código, donde podrás interactuar con el asistente como si fuera un compañero más. Solo tienes que decirle lo que quieres hacer o preguntarle lo que no entiendes, y él te dará la respuesta más adecuada según tu situación.</p><p><br></p><p>Además, Copilot X está al día con las últimas tecnologías y documentaciones disponibles en GitHub, React, MDN y Azure. Así podrás programar en diferentes lenguajes y frameworks sin problemas. Y si quieres programar con la voz, solo tienes que decir \"Hey, GitHub\" y empezar a dictar tu código o tus consultas. Copilot X se encargará de transcribirlo y ejecutarlo.</p><p><br></p><p>GitHub Copilot X es una revolución en el desarrollo de software impulsado por IA. Te ayudará a mejorar tu productividad, tu creatividad y tu aprendizaje. Si quieres probarlo, puedes apuntarte a la lista de espera que tiene GitHub para acceder a la versión previa. No pierdas esta oportunidad de experimentar el futuro de la programación.</p>','[]',1,1,1,0,0,2,'default',NULL,NULL,'2025-11-20 00:00:00','2025-12-09 00:00:00','2025-11-03 00:00:00',NULL),(134,'hola-mundof','default','HOLA MUNDO','','Content of the page','[]',1,1,1,0,0,0,'default',NULL,NULL,'2025-11-21 00:00:00','2025-12-13 00:00:00','2025-11-30 00:00:00','2025-12-16 23:54:48'),(135,'javascript-es-un-lenguaje-de-programacio','default','JavaScript es un lenguaje de programació','','JavaScript es un lenguaje de programación que ha ido evolucionando con el tiempo, incorporando nuevas características y mejoras en cada versión del estándar ECMAScript. Algunas de las últimas actualizaciones de JavaScript son la introducción de los métodos privados y de acceso en las clases, el operador de asignación lógica, el método replaceAll() para las cadenas y la compatibilidad con los módulos. Estas novedades facilitan el desarrollo web y permiten escribir código más eficiente, legible y modular. Para aprovecharlas, es importante estar al día de las versiones de los navegadores y del aplicativo Autofirma, que requieren el uso del archivo autoscript.js actualizado.','null',1,1,1,0,0,2,'default',NULL,NULL,'2025-12-17 00:00:00','2025-11-26 00:00:00','2025-11-15 00:00:00',NULL),(136,'javascript-es-un-lenguaje-de-programacio','default','JavaScript es un lenguaje de programació','','JavaScript es un lenguaje de programación que ha ido evolucionando con el tiempo,','null',1,1,1,0,0,2,'default',NULL,NULL,'2025-12-09 00:00:00','2025-12-18 00:00:00','2025-11-19 00:00:00',NULL);
